import React, { Component } from 'react'
import { logout } from '../store/actions/logoutActions';
class Logout extends Component {

    handleClick = (e) => {
        this.props.logout();
    }


    render() {
        return (
            <div>
                <button onClick={this.handleClick} href="#">Logout</button>
            </div>
        )
    }
}

export default Logout;
